import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { useContext } from 'react';
import { Button, Icon } from 'react-native-elements';
import { useAuth, UserProvider } from './context/auth.context';
import SignIn from './screens/user/SignIn';
import SignUp from './screens/user/SignUp';

export const provider = (provider, props = {}) => [provider, props];
export const ProviderComposer = ({ providers, children }) => {
  for (let i = providers.length - 1; i >= 0; --i) {
    const [Provider, props] = providers[i];
    children = <Provider {...props}>{children}</Provider>
  }
  return children;
}



const Stack = createNativeStackNavigator()
export default function App() {

  return (
    <ProviderComposer
      providers={[
        provider(UserProvider)
      ]}
    >
      <NavigationContainer>
        <Stack.Navigator initialRouteName={"SignIn"} screenOptions={screenOptions}>
          <Stack.Screen
            name={SignUp.name}
            component={SignUp}
            options={{ title: "Registrar-se" }}
          />
          <Stack.Screen
            name={SignIn.name}
            component={SignIn}
            options={({ navigation }) => {
              return {
                title: "Entrar",
                headerRight: () => (<Button
                  type="clear"
                  onPress={() => navigation.push(SignUp.name)}
                  icon={<Icon name="add" size={25} />}
                >
                </Button>),
              }
            }
            }
          />
        </Stack.Navigator>
      </NavigationContainer>
    </ProviderComposer>
  );
}
const screenOptions = { headerStyle: { backgroundColor: '#db4a39' }, headerTintColor: '#fff' }
